# Bitmap display starter code
#
# Bitmap Display Configuration:
# - Unit width in pixels: 4
# - Unit height in pixels: 4
# - Display width in pixels: 512
# - Display height in pixels: 256
# - Base Address for Display: 0x10008000 ($gp)
#
# Equivalences
# Codes will determine what type of block it is
# 0xAARRGGBB
# The AA field will be used to define whether a block is permeable or can damage the play
# 00 - will not damage the user is permeable (air)
# 01 - will not damage the user is not permeable (wall)
# 02 - will damage the user is pearmeable (we want the user to see that they walked into a saw/spike)

.eqv BASE_ADDRESS 0x10008000

.eqv MS_PER_FRAME 100
.eqv UNIT_PER_PIX 4
.eqv WIDTH 128
.eqv HEIGHT 64
.eqv WIDTH_BY_4 512
.eqv HEIGHT_BY_4 256

# these will be our colours
.eqv sawDarkGrey 0x028d8d8f
.eqv sawLightGrey 0x02e6e6e6
.eqv sawBlack 0x02000000
.eqv backgroundBlack 0x00020203

.data
debugOne: .asciiz "Register value "
newline: .asciiz "\n"

# number of saws that we have
sawCount: .word 2

# this will store the starting locations of the saws
sawStarting: .word 29864, 3040

# this will store the end locations of the saws
sawEnding: .word 30024, 24448

# this will store the state that saws are in frame (1 - 3)
sawStates: .word 0, 1, 2, 0, 1 , 2

# this will store the current locations of the saws (based on their centers)
sawLocations: .word 29864, 3040

# these will store which direction the saw is currently moving in
# 0: stationary
# -1: left
# 1: right
# 2: up
# -2: down
sawDirections: .word 1, -2, 0, 0, 0, 2

# these will store the state that the moving spike groups are in frames 1-7
spikeGroupStates: .word 1, 7, 1

# array containing the entire background so we can reference to redraw sections when overwritten
background: .word 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00444444, 0x00171717, 0x00565656, 0x00454545, 0x00636363, 0x002a2a2a, 0x00636364, 0x00454545, 0x00454545, 0x00454545, 0x00626263, 0x002a2a2a, 0x00636364, 0x00616161, 0x00454545, 0x002a2a2a, 0x00181818, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00444444, 0x00171717, 0x00636364, 0x00494949, 0x00454545, 0x002a2a2a, 0x00636364, 0x00000000, 0x00464646, 0x00626263, 0x00636364, 0x002c2c2c, 0x00535353, 0x00454545, 0x005c5c5d, 0x002a2a2a, 0x00181818, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x